  'Хочу поблагодарить и рекомендовать мастеров из компании myseahomes. Профессиональная четкая консультация и ремонт. Знатоки своего дела. Не пытаются обмануть или развести. Выполнили очень сложную работу по замене водяной помпы в бассейне и резервуара с песком. Поставили нужную помпу и остальные комплектующие с моего согласия и заранее со мной все согласовав. Отзыв пишу через 2 недели после выполненных работ. Проверял работу. Так вот по итогу все работает лучше чем раньше. Это факт. На самом деле отличные мастера и прекрасные в общении люди. Не сомневайтесь, обращайтесь к ним. Теперь они же и обслуживают мой бассейн. Он всегда чистый и в воде правильный уровень ph. Это очень важно для моих детей!' =>
