  'Отзыв Marina Garanin' => 'Marina Garanin',
  'Дорогие друзья! Хочу порекомендовать вам компанию myseahomes! Обратились к ним, когда купили пентхаус на берегу моря, по разного рода вопросам, начиная от установки душа на террасе, до ремонтов сантехники и электропроводки. Приехали незамедлительно, изучили все прроблемы и выслушали все наши пожелания. Сделали рассчет и выслали нам смету. Мы сделали аванс и пошла работа. Выполнили все, о чем договаривались и даже гораздо больше. Сами нашли много проблемных мест в квартире и устранили из бонусом, бесплатно. Громадное вам спасибо! Кстати, потом они предложили нам взять нашу квартиру в обслуживание и в работу по аренде, пока мы в ней не живем. Мы согласились и очень довольны! Арендаторов отбирают качественно. Деньги в срок получаем. Все супер!' =>
    'Sevgili dostlar! Size Myseahomes şirketini tavsiye etmek istiyorum. Deniz kıyısında bir çatı katı satın aldıklarında, terasta duş tesisatından sıhhi tesisat ve kablolama onarımlarına kadar çeşitli konularda onlara ulaştılar. Hemen geldik, tüm sorunları inceledik ve tüm isteklerimizi dinledik. Hesaplamayı yaptık ve bize bir tahminde bulunduk. Avans yaptık ve işe başladık. Anlaştığımız her şeyi ve hatta çok daha fazlasını gerçekleştirdik. Size çok teşekkür ederim! Bu arada, daha sonra biz orada yaşamadığımız sürece dairemizi hizmete almamızı ve kiralamaya çalışmamızı önerdiler. Kabul ettik ve çok mutluyuz! Kiracılar niteliksel olarak seçilir. Parayı zamanında alırız. Her şey harika',
