  'Отзыв Дениса Аверкиева' => 'Denis Averkiev',
  'Самые высокие оценки и позитивные отзывы о сотрудничестве с компанией myseahomes! Работа еще в процессе, но я нисколько не сомневаюсь в том, что результат получится потрясающий. Спасибо огромное за колоссальное внимание к деталям и моим пожеланиям, предложение нестандартных, но удобных решений, рекомендации по выбору комплектующих, помощь в поиске и заказе, ответы на многочисленные мои вопросы и за то, что выполнить условия соглашения формально - это не про Вас, от слова "совсем". Большая удача иметь дело с профессионалами, по-настоящему влюбленными в то, что они делает и ориентированным на поиск комфортного решения и оптимального соотношения эстетики/функциональности/расходов. С удовольствием рекомендую Вас и обязательно вернусь с новыми проектами.' =>
    'My sea homes ile işbirliği hakkında en yüksek puanlar ve olumlu geri bildirimler! Çalışma hala devam ediyor, ancak sonucun şaşırtıcı olacağından hiç şüphem yok. Detaylara ve isteklerime büyük özen gösterdiğiniz için çok teşekkür ederim, standart olmayan ancak kullanışlı çözümler önermek, bileşenleri seçmek için öneriler sunmak için çok teşekkür ederim ve bulma ve sipariş verme konusunda yardım, sorularımın çoğuna cevap verme. Yaptıklarına gerçekten aşık olan profesyonellerle uğraşmak için büyük şans, uygun bir çözüm bulmaya ve estetik / işlevsellik / harcamaların optimal oranına odaklanarak. Sizi memnuniyetle tavsiye ederim ve kesinlikle yeni projelerle geri döneceğim.',
  'Денис Аверкиев' => 'Denis Averkiyev',
  'Отзыв Rafet Safet Nuri' => 'Rafet Safet Nuri',
  'Отличная работа Александра и его команды. Убрали деревья и кустарник на участке с ювелирной точность и очень быстро. Ребята приехали в точно договорённое время встречи и после согласования всех деталей приступили к работе, которую сделали гораздо раньше времени. Это было очень приятной неожиданностью. По цене сделали небольшую скидку на весь объём работ. Настоятельно рекомендуем. Настоящие профессионалы своего дела, бригада хорошо технически оснащена. В настоящее время они и обслуживают нашу недвижимость и сад и бассейн.' =>
    'Alexander ve ekibi tarafından harika bir iş çıkardınız. Bölgedeki ağaçları ve çalıları mücevher hassasiyetle ve çok hızlı bir şekilde temizledik. Ustalalr toplantının tam olarak anlaşıldığı tarihte geldiler ve tüm detayları kabul ettikten sonra, zamanın çok ilerisinde yaptıkları işe başladılar. Bu çok hoş bir sürprizdi. Fiyat için tüm iş hacmi için küçük bir indirim yaptılar. Şiddetle tavsiye ediyoruz. İşinin gerçek profesyonelleri olan ekip, teknik olarak iyi donanımlıdır. Şu anda konutlarımız, bahçemize ve havuzumuza hizmet ediyorlar.',
  'Rafet Safet Nuri' => 'Rafet Safet Nuri',
  'Отзыв Бахрама' => 'Bahram',
