    'Myseahomes ile işbirliği yapmak benim için kolay ve çok tatmin edici. Onların büyük profesyonelliklerini, teknik desteklerini ve serbest durumlara ve çeşitli ekipman arızalarına hızlı yanıt vermede yardımcı olduklarını hissediyorum. Elektrikle ilgili bir sorun varsa - Myseahomes\'u ararım, sıhhi tesisat ile ilgili bir sorun - Myseahomes\'u ararım. Buna ek olarak, havuz ve bahçeye kaliteli ve profesyonelce planlı bakım yaparlar.',
  'Бахрам' => 'Bahram',
  'Отзыв Виталия Павлова' => 'Vitaly Pavlov',
  'Спасибо огромное за ваш добросовестный труд. Всегда приятно сотрудничать с настоящими профессионалами, которые точно знают, что и как нужно сделать, чтобы порадовать своих клиентов. Я постоянно обращаюсь за решением разного рода вопросов в myseahomes, от разовой очистки участка, до постоянного обслуживания садов, вилл и бассейнов моих клиентов. Всем им рекомендую mysehomes. Ни разу не подвели. Оборудованы по высшему разряду, профессионалы в своих направлениях. Можно легко рекомендовать, потому, что гарантия качества.' =>
    'Gayretli çalışmanız için çok teşekkür ederim. Müşterilerini memnun etmek için tam olarak ne ve nasıl yapılması gerektiğini bilen gerçek profesyonellerle işbirliği yapmak her zaman bir zevktir. My sea homes\'da sürekli olarak her türlü sorunun çözümünü arıyorum. Hepinize Mysehomes\'u tavsiye ederim. Her zaman yardım edecekler. En üst düzeyde donanıma sahipler, profesyoneller kendi yönlerinde. Kalite garantisi nedeniyle kolayca tavsiye edilebilir.',
  'Виталий Павлов' => 'Vitaly Pavlov',
  'Отзыв Михаила Елшина' => 'Mikhail Elshin',
  'Очень доволен работой. Оперативно качественно и добросовестно работают ребята. Всегда приезжают обслуживать в обещанные дни. Проверят ph в бассейне, делают контрольный осмотр машинного отделения, заменяют поломанные пластиковые решетки. У них современные пылесосы для очистки бассейна и вообще все оборудование. Пользуюсь услугами myseahomes и рекомендую другим!' =>
    'İşten çok memnunum. Ustalar derhal niteliksel ve sadakatle çalışırlar. Her zaman vaat edilen günlerde hizmet vermeye gelirler.  Havuzdaki pH\'ı kontrol edilir,  makine dairesinin kontrol muayenesini yapılır, kırık plastik ızgaraları değiştirin. Havuzu temizlemek için modern elektrikli süpürgeleri ve genel olarak tüm ekipmanları var. Myseahomes hizmetlerini kullanıyorum ve başkalarına tavsiye ediyorum!',
  'Михаил Елшин' => 'Mikhail Jelgin',
  'Отзыв Polina Uzbekova' => 'Polina Uzbekova',
  'Не могу представить нашу жизнь без копании myseahomes. Участок в нашем новом доме огромный и ухаживать за ним я, лично, не успеваю никак. Остальные члены семьи также. Муж работает, я работаю. Мама любит иногда приехать повозится в саженцах, и все. А подрезать зеленые ограждения, подвязать туи, накрыть цветы и т.д. она не слишком любит. Я молчу о регулярной прополке. Мы позвонили в эту компанию, они приехали, оценили объем работ, согласовали по цене и все. Теперь моя головная боль снята, а сад цветет и пахнет))' =>
    'Myseahomes şirketi olmadan hayatımızı hayal bile edemiyorum. Yeni evimizdeki arsa çok büyük ve ben şahsen ona bakmak için zamanım yok. Ailenin geri kalanı da öyle. Kocam çalışıyor, ben çalışıyorum. Annem bazen gelip fidanlarla uğraşmayı sever, hepsi bu. Yeşil çitleri kesmeniz, tuyaları bağlamanız, çiçekleri örtmeniz gerekiyor, ama annem bunu yapmaktan pek hoşlanmıyor. Bu şirketi aradık, geldiler, iş hacmini değerlendirdiler, fiyat konusunda anlaştılar ve hepsi bu kadar. Şimdi mutluyum ve bahçe çiçek açıyor ve kokuyor',
  'Polina Uzbekova' => 'Polina Uzbekova',
  'Отзыв Икароса и Елены Оркошнели' => 'Ikaros and Elena Orkoshneli',
  'Хочу порекомендовать компанию по обслуживанию myseahomes! Когда в нашем бассейне начала цвести вода, мы побоялись им пользоваться и обратились в «myseahomes». Специалисты нашли причину, все почистили и поменяли фильтры. Понравилось обслуживание, главное – никто не навязывал ничего лишнего. Оказалось, что они обслуживают еще и сады. У нас был другой садовник до этого, который постоянно забывал приехать, делал работу на половину и т.д. Вот мы и решились попробовать эту компанию, еще не разу не пожалели! Все супер! ' =>
    'Myseahomes servis şirketini tavsiye etmek istiyorum! Havuzumuzda su bozulmaya başladığında, onu kullanmaktan korktuk ve Myseahomes\'u aradık. Uzmanlar sebebini buldular, her şeyi temizlediler ve filtreleri değiştirdiler. Hizmeti beğendim, en önemlisi - hiç kimse gereksiz bir şey empoze etmedi. Ayrıca bahçelere de hizmet ederler. Daha önce başka bir bahçıvanımız vardı, sürekli gelmeyi unutmuş, yarı zamanlı iş yapmış olan. şimdi bu şirketi denemeye karar verdik, hiç pişman olmadık! Her şey harika',
  'Икарос и Елена Оркошнели' => 'Ikaros ve Elena Orkoshneli',
  'Отзыв Nazgul Alymbaeva' => 'Nazgul Alymbaeva',
  'Хочу выделить компанию myseahomes по обслуживанию участков на виллах (садов) и обслуживанию бассейнов в Кирении. Уже 2 месяца эти ребята работают на моем участке. То что получается не выразить словами! Просто восхитительная работа! Рекомендую. Ваша Назгуль.' =>
    'Myseahomes şirketini villalardaki arazilerin bakımı ve Girne\'deki havuzların bakımı konusunda övgü almak istiyorum. Bu adamlar iki aydır bahçemde  çalışıyorlar. Sadece harika bir iş! Öneriyorum',
  'Nazgul Alymbaeva' => 'Nazgul Alymbaeva',
  'Отзыв Ahmet Sukru Yankin' => 'Ahmet Sukru Yankin',
  'Все грамотно, быстро и профессионально. Я выбрал эту компанию для обслуживания моего сада и бассейна. Еще ни разу не пожалел. Оснащены по последнему слову техники. Видно, что имеют большой опыт в этом деле. Решают любую проблему. Рекомендую всем.' =>
    'Her şey yetkin, hızlı ve profesyonelce. Bahçeme ve havuzuma hizmet etmek için bu şirketi seçtim. Daha önce hiç pişman olmadım. Son teknoloji ile donatılmıştır. Görünüşe göre bu davada çok deneyime sahipler. Herhangi bir sorunu çözüyorlar. Herkese tavsiye ederim.',
  'Ahmet Sukru Yankin' => 'Ahmet Şukru Yankin',
  'Отзыв Рашита Юнусова' => 'Отзыв Rashit Yunusov',
  'Уже несколько лет заказываю обслуживание бассейна и сада в «myseahomes». Ребята всегда приезжают в оговоренное время и работу делают на самом высшем уровне – быстро и главное всегда очень качественно. Всем рекомендую эту компанию. Уже и все соседи переключились на нее. Ребята держат свой имидж и обращаться к ним одно удовольствие.' =>
    'Birkaç yıldır Myseahomes\'ta havuz ve bahçe hizmeti veriyorum. Ustalar her zaman kararlaştırılan zamanda gelirler ve işleri en üst düzeyde yaparlar - hızlı ve en önemlisi her zaman çok niteliklidir. Herkese bu şirketi tavsiye ederim. Zaten tüm komşular hizmetlerini kullanıyor. Ustalar imajlarını koruyorlar. biz çok mutluyuz.',
